<!DOCTYPE html>
<html>
<head>
<title>Print the list of passport numbers without duplicates.

</title>
</head>
<script>
data = ['A23', 'B56', 'B56', 'C79', 'D16' ]
var unique=[];
data.forEach(e=>{
    if(!unique.includes(e)){
        unique.push(e)
    }
})

console.log(unique.join(' '))

</script>
<body>

    <title>Print the list of passport numbers without duplicates.

    </title>
    <p>Check in console</p>

</body>
</html>
